BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" text NOT NULL);
CREATE TABLE "materials" ("id" SERIAL PRIMARY KEY AUTOINCREMENT NOT NULL, "category" text, "subcategory" text, "measurements" text, "product" text, "product_number" text, "product_description" text, "uom" text, "price" float, "in_stock" float, "vendor" text, "total" float, "created_at" timestamp, "updated_at" timestamp);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
